// Modules //
import React from 'react';
import axios from 'axios';

// Style //
import Button from 'react-bootstrap/Button';

class Main extends React.Component {

  constructor() {
    super();

    this.state = {
      ArticlesPopulaire: [],
    };
  }

  componentDidMount() {
    axios.get("http://localhost:8000/").then((data) => {
      //console.log(data.data);
      this.setState({
        ArticlesPopulaire: data.data,        
      })
      console.log(data);
    }).catch(function(error) {
      if (!error.status) {
        console.log(error);
      }
    })
  }

  render() {
    return (
      <div>
        <Button>juncotton</Button>
      </div>
    );
  }
}

export default Main;
